    <HomeContainer>
      <Navbar />
      <HeroSection />
      {/* <CovidChart /> */}
      <SolutionSteps />
      <Advantages />
      <Specialities />
      <Footer />
    </HomeContainer>
  );
};

export default HomeScreen;
